import React, { FC } from 'react';

interface NavigationProps {
    link1: string;
    link2: string;
    link3: string;
    link4: string;
}

const Navigation: FC<NavigationProps> = ({ link1, link2, link3, link4 }) => {
  return (
    <nav className="flex-row bg-slate-800 relative container p-6 justify-between mx-auto underline text-3x1">
      <h1><a className="text[#35A853]" href="resume.pdf" download>{link1}</a></h1>
      <h1><a href="#portfolio">{link2}</a></h1>
      <h1><a href="#contact">{link3}</a></h1>
      <h1><a href="#blog">{link4}</a></h1>
    </nav>
  );
};

export default Navigation;
